import { Tile, Box, Media, MediaContent, 
    MediaLeft, MediaRight, Content, Image, Progress } from 'bloomer';

export default function TileItem({ title, subtitle }) {
    return (
        <Tile isParent>
            <Tile
                title={ title }
                subtitle={ subtitle }
                isChild
                render={
                    props => (
                        <Box {...props}>
                            <Media>
                                <MediaLeft>
                                <Image isSize='64x64' src='https://via.placeholder.com/128x128' />
                                </MediaLeft>
                                <MediaContent>
                                    <Content>
                                        <p>
                                            <strong>Fulana de Tal</strong><br/>
                                            Musculação<br/>
                                            <strong><small>fulana@email.com</small></strong>
                                        </p>
                                    </Content>

                                </MediaContent>
                            </Media>
                            <Progress isColor='primary' value={100} max={100}/>
                        </Box>
                    )
                }
            />
        </Tile>
    );
}
